define({"topics" : [{"title":"Definition","shortdesc":"\n            <p class=\"shortdesc\">Das Korpus beinhaltet ausschließlich Datenstrukturen. Auf dem Digitalisat sind einzelne Regionen entsprechend des PAGE-Schema\n               ausgezeichnet.\n            </p>\n         ","href":"structur_gtdefinition.html","attributes": {"data-id":"structur_gtdefinition",},"menu": {"hasChildren":false,},"tocID":"structur_gtdefinition-d66e3941","topics":[]},{"title":"Grundlage","shortdesc":"\n            <p class=\"shortdesc\">Das OCR-D Struktur Ground-Truth-Korpus umfasst Publikationen aus dem Zeitraum 1500 - 1900.</p>\n         ","href":"structur_gtgrundlage.html","attributes": {"data-id":"structur_gtgrundlage",},"menu": {"hasChildren":false,},"tocID":"structur_gtgrundlage-d66e3985","topics":[]},{"title":"Übersicht und Konkordanz","shortdesc":"\n            <p class=\"shortdesc\">Die Übersicht und Konkordanz stellt im Vergleich Kodierungen von Zonen und Regionen im DTA Zot-Format, DTABf (TEI) und dem\n               PAGE-Format dar. Der Verweis auf die Element im DTABf bezieht sich nur auf grundlegende Elemente und nicht deren Kontext.\n               Aus diesem Grund sei auf die Dokumentation des DTABf hingewiesen.\n            </p>\n         ","href":"structur_gtpageformat.html","attributes": {"data-id":"structur_gtpageformat",},"menu": {"hasChildren":false,},"tocID":"structur_gtpageformat-d66e4029","topics":[]}]});